bool EDAccess::connection_is_possible(string const& ele1,string const& ele2) {
    last_e1 = ele1;
    last_e2 = ele2;
    if (ele1 < ele2) {
        last_questioned = EDnew::position_map.find(string(ele1+ele2));
        if (last_questioned != EDnew::position_map.end()) {
            return true;
        } else return false;
    } else {
        last_questioned = EDnew::position_map.find(string(ele2+ele1));
        if (last_questioned != EDnew::position_map.end()) {
            return true;
        } else return false;
    }
}
bool EDAccess::angle_exists(string const& ele) {
    angle_last_e = ele;
    angle_last_questioned = EDnew::angle_position_map.find(ele);
    if (angle_last_questioned != EDnew::angle_position_map.end()) {
        return true;
    } else return false;
}
float const& EDAccess::get_probability(int const& bond_order,float const& dist) { // bond_order muss 0,1,2,3,4 sein <- Keine Pruefung!
    if (last_questioned->second.get_element(bond_order,0) > -1) {
        int bin = int(dist/EDnew::ED_bin_size);
        if (bin < last_questioned->second.get_element(bond_order,1) || bin > last_questioned->second.get_element(bond_order,2)) {
            if (bin < last_questioned->second.get_element(bond_order,1)) {
                if (bond_order == 3) return ED_min_val;
                else if (bond_order == 2 && last_questioned->second.get_element(3,0) < 0) return ED_min_val;
            }
            return ED_dummy;
        } else return bond_data[last_questioned->second.get_element(bond_order,0) + bin - last_questioned->second.get_element(bond_order,1)];
    } else return ED_dummy;
}
float const& EDAccess::get_angle_probability(int const& hyb,float const& angle) {
    if (angle_last_questioned->second.get_element(hyb,0) > -1) {
        int bin = int(angle/EDnew::ED_angle_bin_size);
        if (bin < angle_last_questioned->second.get_element(hyb,1) || bin > angle_last_questioned->second.get_element(hyb,2)) {
            if (bin > angle_last_questioned->second.get_element(hyb,2)) {
                if (hyb == 0) return ED_min_val;
                else if (hyb == 1 && angle_last_questioned->second.get_element(0,0) < 0) return ED_min_val;
                else if (bin < angle_last_questioned->second.get_element(0,1)) return ED_min_val;
            }
            return ED_dummy;
        } else return angle_data[angle_last_questioned->second.get_element(hyb,0) + bin - angle_last_questioned->second.get_element(hyb,1)];
    } else return ED_dummy;
}
float const& EDAccess::get_probability(string const& ele1,string const& ele2,int const& bond_order,float const& dist) { // bond_order muss 0,1,2,3,4 sein <- Keine Pruefung!
    if (ele1 != last_e1 || ele2 != last_e2) {
        if (!connection_is_possible(ele1,ele2)) return ED_dummy;
    } else if (last_questioned == EDnew::position_map.end()) return ED_dummy;
    return get_probability(bond_order,dist);
}
float const& EDAccess::get_angle_probability(string const& ele,int const& hyb,float const& angle) {
    if (ele != angle_last_e) {
        if (!angle_exists(ele)) return ED_dummy;
    } else if (angle_last_questioned == EDnew::angle_position_map.end()) return ED_dummy;
    return get_angle_probability(hyb,angle);
}
float EDAccess::get_max_probability(float const& dist) {
    int bin = int(dist/EDnew::ED_bin_size);
    float best = -1.;
    for (int i=0; i<4; ++i) {
        if (bin < last_questioned->second.get_element(i,1) || bin > last_questioned->second.get_element(i,2)) {
            if (best < 0.) {
                if (bin < last_questioned->second.get_element(i,1)) {
                    if (i == 3) best = ED_min_val;
                    else if (i == 2 && last_questioned->second.get_element(3,0) < 0) best = ED_min_val;
                }
            }
            continue;
        } else if (bond_data[last_questioned->second.get_element(i,0) + bin - last_questioned->second.get_element(i,1)] > best) {
            best = bond_data[last_questioned->second.get_element(i,0) + bin - last_questioned->second.get_element(i,1)];
        }
    }
    return (best);
}
float EDAccess::get_max_angle_probability(float const& angle) {
    int bin = int(angle/EDnew::ED_angle_bin_size);
    float best = -1.;
    for (int i=0; i<3; ++i) {
        if (bin < angle_last_questioned->second.get_element(i,1) || bin > angle_last_questioned->second.get_element(i,2)) {
            if (best < 0.) {
                if (bin > angle_last_questioned->second.get_element(i,2)) {
                    if (i == 0) return ED_min_val;
                    else if (i == 1 && angle_last_questioned->second.get_element(0,0) < 0) return ED_min_val;
                    else if (bin < angle_last_questioned->second.get_element(0,1)) return ED_min_val;
                }
            }
            continue;
        } else if (angle_data[angle_last_questioned->second.get_element(i,0) + bin - angle_last_questioned->second.get_element(i,1)] > best) {
            best = angle_data[angle_last_questioned->second.get_element(i,0) + bin - angle_last_questioned->second.get_element(i,1)];
        }
    }
    return (best);
}
float EDAccess::get_max_probability(string const& ele1,string const& ele2,float const& dist) {
    if (ele1 != last_e1 || ele2 != last_e2) {
        if (!connection_is_possible(ele1,ele2)) return ED_dummy;
    } else if (last_questioned == EDnew::position_map.end()) return ED_dummy;
    return get_max_probability(dist);
}
float EDAccess::get_max_angle_probability(string const& ele,float const& angle) {
    if (ele != angle_last_e) {
        if (!angle_exists(ele)) return ED_dummy;
    } else if (angle_last_questioned == EDnew::angle_position_map.end()) return ED_dummy;
    return get_max_angle_probability(angle);
}
